// @require file:///home/<homedir>/.config/synack/login.js
// @grant none
// ==/UserScript== alert('Change the require line to point to the right place and delete this line. Also modify tampermonkey to be able to read local files. This is probably really dumb, so I will not tell you how to do this in an effort to make certain you have thought it through.'); Note: You must change the @require line to the location of the login.js file. Additionally, you will want to delete the alert().

